     body {
  font-family: 'Ubuntu', Arial;
  padding: 0;
  margin: 0;
}



.card {
  width: 20%;
  overflow: hidden;
  margin-left: 15px;
  padding: 20px;
  cursor: default;
  color: #fff;
  text-align: center;
  float: left;
  margin-bottom: 15px;
}

.facebook {
  background-color: #3b5998;
}

.instagram {
  background-color: #f77737;
}

.twitter {
  background-color: #1da1f2;
}

.google {
  background-color: #dd4b39;
}

.card h1, 
.card p {
  transition: all 0.5s ease-in-out;
}

.card p {
  float: left;
  width: 5%;
  padding: 5px;
}



.card:hover h1{
  transform: scale(1.1);
}

@media(max-width: 768px) {
  .card {
    width: 100%;
    margin-left: 0;
    margin-right: 0;
    padding: 0;
    padding-top: 5px;
    padding-bottom: 5px;
  }
  
  .card button {
     margin-right: 5px;
  }
}
